import React from 'react';
import './SuspiciousTransactionSummary.css';

const SuspiciousTransactionSummary = ({ suspiciousData }) => {
  if (!suspiciousData || !suspiciousData.summary) return null;

  const { summary, flags } = suspiciousData;
  
  // Don't display if there are no flags
  if (summary.totalFlags === 0) return null;

  return (
    <div className="suspicious-summary">
      <h2>‚ö†Ô∏è Transaction Alerts & Risk Summary</h2>
      
      <div className="alert-stats-grid">
        <div className="alert-stat-card total-flags">
          <div className="stat-icon">üîç</div>
          <div className="stat-content">
            <h3>Total Alerts</h3>
            <p className="stat-value">{summary.totalFlags}</p>
          </div>
        </div>

        <div className="alert-stat-card high-risk">
          <div className="stat-icon">üö®</div>
          <div className="stat-content">
            <h3>High Risk</h3>
            <p className="stat-value">{summary.highRisk}</p>
            <p className="stat-detail">Requires immediate review</p>
          </div>
        </div>

        <div className="alert-stat-card medium-risk">
          <div className="stat-icon">‚ö†Ô∏è</div>
          <div className="stat-content">
            <h3>Medium Risk</h3>
            <p className="stat-value">{summary.mediumRisk}</p>
            <p className="stat-detail">Needs attention</p>
          </div>
        </div>

        <div className="alert-stat-card low-risk">
          <div className="stat-icon">‚ÑπÔ∏è</div>
          <div className="stat-content">
            <h3>Low Risk</h3>
            <p className="stat-value">{summary.lowRisk}</p>
            <p className="stat-detail">Minor issues</p>
          </div>
        </div>

        {summary.transfersDetected > 0 && (
          <div className="alert-stat-card transfers">
            <div className="stat-icon">üîÑ</div>
            <div className="stat-content">
              <h3>Non-Taxable Transfers</h3>
              <p className="stat-value">{summary.transfersDetected}</p>
              <p className="stat-detail">Internal wallet movements</p>
            </div>
          </div>
        )}

        {summary.redFlags > 0 && (
          <div className="alert-stat-card red-flags">
            <div className="stat-icon">üö©</div>
            <div className="stat-content">
              <h3>Red Flags</h3>
              <p className="stat-value">{summary.redFlags}</p>
              <p className="stat-detail">Extreme gains/losses detected</p>
            </div>
          </div>
        )}
      </div>

      {/* Key Issues Section */}
      {flags && flags.length > 0 && (
        <div className="key-issues-section">
          <h3>Key Issues Detected</h3>
          <div className="issues-list">
            {/* Group flags by rule */}
            {Object.entries(
              flags.reduce((acc, flag) => {
                if (!acc[flag.rule]) {
                  acc[flag.rule] = { count: 0, risk: flag.risk, examples: [] };
                }
                acc[flag.rule].count++;
                if (acc[flag.rule].examples.length < 3) {
                  acc[flag.rule].examples.push(flag);
                }
                return acc;
              }, {})
            ).map(([rule, data]) => (
              <div key={rule} className={`issue-item issue-${data.risk}`}>
                <div className="issue-header">
                  <span className="issue-title">{rule}</span>
                  <span className={`issue-count risk-${data.risk}`}>{data.count} occurrence(s)</span>
                </div>
                <div className="issue-examples">
                  {data.examples.map((flag, idx) => (
                    <p key={idx} className="issue-example">
                      Line {flag.lineNumber}: {flag.message}
                    </p>
                  ))}
                  {data.count > 3 && (
                    <p className="issue-more">... and {data.count - 3} more</p>
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Recommendations */}
      <div className="recommendations-section">
        <h3>üí° Recommendations</h3>
        <ul className="recommendations-list">
          {summary.highRisk > 0 && (
            <li className="recommendation high">
              Review all <strong>High Risk</strong> items immediately to ensure tax calculation accuracy.
            </li>
          )}
          {summary.transfersDetected > 0 && (
            <li className="recommendation medium">
              Verify that <strong>{summary.transfersDetected} transfer(s)</strong> are correctly marked as 
              non-taxable internal wallet movements.
            </li>
          )}
          {summary.redFlags > 0 && (
            <li className="recommendation high">
              Investigate <strong>{summary.redFlags} transaction(s)</strong> with extreme gains or losses 
              (10,000%+ gains or 99%+ losses) for data accuracy.
            </li>
          )}
          <li className="recommendation low">
            Expand transaction rows in the table below to see detailed alerts and FIFO lot information.
          </li>
        </ul>
      </div>
    </div>
  );
};

export default SuspiciousTransactionSummary;
